    data: |
      SELECT DISTINCT + - 73 * + CAST ( - - 49 AS REAL ) AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - CAST ( - + col2 AS INTEGER ) + - + col0 NOT IN ( - col2, - col1 * + col1 );
  - name: tab0

outputs:
  - name: q4069.out
    data: |
